const getUsers = (req, res) => {
  User.find()
    .then((users) => res.json(users))
    .catch((err) => res.status(400).json(`get user failed ${err.message}`));
};

const getAddPage = (req, res) => {
  // fs.readFile(path.resolve('..'))
