  let user = new User(req.body);

  user
    .save()
    .then(() => res.json("user added!"))
    .catch((err) => res.status(400).json(`add user failed ${err.message}`));
};

const getUserById = (req, res) => {
  let { id } = req.params;

  User.findById(id)
